// Poseidon helpers (Starknet-native)
fn poseidon4(inputs: [Field; 4]) -> Field {
    poseidon::poseidon::bn254::hash_4(inputs)
}

fn poseidon2(inputs: [Field; 2]) -> Field {
    poseidon::poseidon::bn254::hash_2(inputs)
}

// Commitment = Poseidon(secret, nullifier, amount, owner)
fn compute_commitment(secret: Field, nullifier_hash: Field, amount: Field, owner: Field) -> Field {
    poseidon4([secret, nullifier_hash, amount, owner])
}

fn compute_nullifier(secret: Field, note_index: Field) -> Field {
    let pre = poseidon2([secret, note_index]);
    poseidon2([pre, 0])
}

fn main(
    root_id_list: pub [Field; 16],
    root_list: pub [Field; 16],
    nullifier_hashes: pub [Field; 16],
    commitment_list: pub [Field; 16],
    new_commitment_1: pub Field,
    new_commitment_2: pub Field,
    token_out: pub Field,
    amount_out: pub Field,
    recipient_withdraw: pub Field,
    // Private inputs
    secret_in_list: [Field; 16],
    note_index_list: [Field; 16],
    amount_in_list: [Field; 16],
    owner_in: Field,
    amount_to_send: Field,
    token: Field,
    recipient: Field,
    new_secret_sender: Field,
    new_note_index_sender: Field,
    new_secret_recipient: Field,
    new_note_index_recipient: Field,
) {
    assert(!amount_to_send.lt(0));
    assert(nullifier_hashes.len() == secret_in_list.len());
    assert(nullifier_hashes.len() == note_index_list.len());
    let mut total_amount_in = 0;

    for i in 0..nullifier_hashes.len() {
        let root = root_list[i];
        if (root_list[i] != 0) {
            let secret_in = secret_in_list[i];
            let nullifier_hash = nullifier_hashes[i];
            let note_index_in = note_index_list[i];
            let amount_in = amount_in_list[i];
            let commitment = commitment_list[i];

            let old_commitment = compute_commitment(secret_in, nullifier_hash, amount_in, owner_in);
            // 2. Merkle proof: prove old_commitment is in tree (depth 16)
            // let mut current = old_commitment;
            // for i in 0..TREE_DEPTH {
            //     let sibling = path[i];
            //     if current.lt(sibling) {
            //         current = poseidon2([current, sibling]); // right
            //     } else {
            //         current = poseidon2([sibling, current]); // left
            //     }
            // }
            // assert(current == root);

            assert(old_commitment == commitment);
            // 3. Nullifier correctness
            assert(compute_nullifier(secret_in, note_index_in) == nullifier_hash);

            total_amount_in += amount_in;
        }
    }

    // 4. Amount conservation
    assert(!total_amount_in.lt(amount_to_send));
    let change_amount = total_amount_in - amount_to_send;

    // 5. Output commitment 1: to recipient
    // if amount_out >= 0 then transact is withdraw mode
    if amount_out == 0 {
        let new_nullifier_out = compute_nullifier(new_secret_recipient, new_note_index_recipient);
        let cm_out1 = compute_commitment(
            new_secret_recipient,
            new_nullifier_out,
            amount_to_send,
            recipient,
        );
        assert(cm_out1 == new_commitment_1);
    } else {
        assert(amount_to_send == amount_out);
        assert(!recipient_withdraw.eq(0));
        assert(recipient == recipient_withdraw);
        assert(token_out != 0);
        assert(token == token_out);
    }

    // 6. Output commitment 2: change back to sender
    if !change_amount.eq(0) {
        let new_nullifier_in = compute_nullifier(new_secret_sender, new_note_index_sender);
        let cm_out2 =
            compute_commitment(new_secret_sender, new_nullifier_in, change_amount, owner_in);
        assert(cm_out2 == new_commitment_2);
    }
}

